import React from 'react';
import {Row,Col} from 'react-bootstrap'
import carBack from '../images/carBack.jpg'
const Presentation = () => {
    return (
        <div>
          <Row>
              <Col sm={8}>
                    <div className="divPresentation">
                          <h1> <span className="presentationDeutsh"> DeutshAutomoto </span>, acheter votre <br/> voiture <span> En toute Securit√©.</span></h1> 
                          <a className="voir nos Voitures"> Voir nos Voitures</a>
                    </div>
              </Col>
              <Col sm={4} className="myImages">
                 <img src={carBack} className="carBack"/>
              </Col>
          </Row>
        </div>
    );
};

export default Presentation;
